INSERT INTO `rodizios` (`id_rodizio`, `titulo_rodizio`, `descricao_rodizio`, `imagem_rodizio`) VALUES
(1, 'Rodízio 6x0', 'No sistema 6x0, também chamado de sistema 6x6, todos farão a função tanto de levantadores como de atacantes ou defensores. É o sistema mais simples de todos, é normalmente usado em equipes que estão iniciando o treinamento no esporte.', );
INSERT INTO `rodizios` (`id_rodizio`, `titulo_rodizio`, `descricao_rodizio`, `imagem_rodizio`) VALUES
(2, 'Rodízio 6x0 com Infiltração', 'A grande inovação do sistema 6×0 com infiltração é exatamente a movimentação de infiltração do jogador da posição 1, que torna-se o Levantador da equipe quando está estiver recebendo o Saque. O jogador que ocupar a posição 1, nesse sistema,   nunca deve participar da recepção do Saque.', );
INSERT INTO `rodizios` (`id_rodizio`, `titulo_rodizio`, `descricao_rodizio`, `imagem_rodizio`) VALUES
(3, 'Rodízio 4x2', 'O sistema 4x2 pode ser dividido entre o 4x2 simples ou com infiltração. No 4x2 simples há dois levantadores, que se colocam nas posições diagonais da quadra, mais quatro atacantes. Com esse sistema, há sempre um levantador na rede juntamente com dois atacantes.', );
INSERT INTO `rodizios` (`id_rodizio`, `titulo_rodizio`, `descricao_rodizio`, `imagem_rodizio`) VALUES
(4, 'Rodízio 4x2 com Infiltração', 'No 4x2 invertido, também chamado de 4x2 com infiltração, (uma vez que há 4 atacantes e 2 levantadoras em quadra), também há dois levantadores e eles também se posicionam em diagonal. No entanto, o levantador que está na zona de ataque se tornará disponível para o ataque e o que estiver na zona de defesa infiltrará, ou seja, passará da zona em que ele está para a zona de ataque para efetuar o levantamento. Assim, sempre haverá 3 atacantes na rede.', );
INSERT INTO `rodizios` (`id_rodizio`, `titulo_rodizio`, `descricao_rodizio`, `imagem_rodizio`) VALUES
(5, 'Rodízio 4x2 com Líbero', 'Neste rodízio, as 4 jogadoras rotativas são as atacantes e as centrais, enquanto as 2 jogadoras fixas são as levantadoras. A cada troca de saque, 2 atacantes e 2 centrais se movimentam no sentido horário, alternando suas posições na quadra. Já as 2 levantadoras ficam sempre nas mesmas posições, 2 e 5, não rodando. O líbero entra na posição mais recuada, substituindo uma das levantadoras.', );
INSERT INTO `rodizios` (`id_rodizio`, `titulo_rodizio`, `descricao_rodizio`, `imagem_rodizio`) VALUES
(6, 'Rodízio 5x1\r\n', 'No rodízio 5x1 segue uma ordem fixa de rotações. O levantador começa na posição 1, que é a posição mais próxima ao fundo da quadra, e o líbero entra em quadra na posição 5, que é a posição de defesa. À medida que o jogo progride e o time ganha pontos, o rodízio continua a seguir essa ordem. O objetivo do rodízio 5x1 é otimizar o desempenho do time, garantindo uma defesa sólida e um ataque eficiente.', );

